package files

import (
	"bytes"
	"io"
	"testing"
)

func TestBase64ImageContainer_NewJPEG(t *testing.T) {
	r := bytes.NewReader([]byte(``))
	c, err := NewBase64ImageContainer(r)
	if err != nil {
		t.FailNow()
	}
	_, _, _, err = c.Image()
	if err != nil {
		t.FailNow()
	}
	ext := c.Extension()
	if ext != "jpeg" {
		t.FailNow()
	}
}

