func TestBase64ImageContainer_Reader(t *testing.T) {
	r := bytes.NewReader([]byte(``))

	t.Logf("Size input reader = %v", r.Len())
	c, err := NewBase64ImageContainer(r)
	if err != nil {
		t.FailNow()
	}

	reader1, err := c.Reader()
	if err != nil {
		t.FailNow()
	}
	n := read(t, reader1)
	if n == 0 {
		t.FailNow()
	}
	t.Logf("read of reader1 = %v", n)

	reader2, err := c.Reader()
	if err != nil {
		t.FailNow()
	}
	n = read(t, reader2)
	if n == 0 {
		t.FailNow()
	}
	t.Logf("read of reader2 = %v", n)

	reader3, err := c.Reader()
	if err != nil {
		t.FailNow()
	}
	n = read(t, reader3)
	if n == 0 {
		t.FailNow()
	}
	t.Logf("read of reader3 = %v", n)
}

func read(_ *testing.T, reader io.Reader) int {
	var N int

	b := make([]byte, 90)
	for {
		n, err := reader.Read(b)
		N += n
		if err == io.EOF {
			break
		}
	}

	return N
}
